/****** Object:  StoredProcedure [dbo].[AddNewSiteProductsBySession]    Script Date: 9.11.2021 21:06:41 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
  CREATE Procedure [dbo].[AddNewSiteProductsBySession]
  (
	 @SessionId nvarchar(70)
  )
  AS
  Begin
	
	Declare @SiteId int
	
	Select @SiteId=SiteId from  Sites Where SiteName = ( Select Top 1 SiteName From  [SiteProductsTemp] Where SessionId=@SessionId)

	if(@SiteId is not null)
	Begin

		INSERT INTO [dbo].[SiteProducts]
			   ([SiteId]
			   ,[BrandName]
			   ,[ProductId]
			   ,[ProductName]
			   ,[Barcode]
			   ,[VariantName]
			   ,[Volume]
			   ,[Type]
			   ,[Gender]
			   ,[IsActive]
			   ,[IsDataPage]
			   ,[ProductUrl]
			   ,[Price]
			   ,[CreatedDate]
			   ,[CreatedUser]
			   ,[UpdatedDate]
			   ,[UpdatedUser])
		Select 
		   @SiteId
		  ,[BrandName]
		  ,NULL
		  ,[ProductName]
		  ,[Barcode]
		  ,[VariantName]
		  ,[Volume]
		  ,[Type]
		  ,[Gender]
		  ,0
		  ,0
		  ,[ProductUrl]
		  ,[Price]
		  ,GETDATE()
		  ,[CreatedUser]
		  ,GETDATE()
		  ,[UpdatedUser]
	  From [SiteProductsTemp] spt
	  Where SessionId = @SessionId
	  And Not Exists
	  (
			Select 1
			From [SiteProducts] sp
			Where sp.[ProductUrl]=spt.ProductUrl 
			And sp.VariantName = spt.VariantName  
			And sp.SiteId=@SiteId
	  )

	  End


  End
GO
